import React, { Component } from "react";
import "./App.css";
import { Route } from "react-router-dom";
import { BrowserRouter } from "react-router-dom";
import FaceRegister from "./components/FaceRegister.js";
import FaceLogin from "./components/FaceLogin.js";

const FaceRecog = () => {
    return (
        <div id="loginform">
            <main className="box">
                <img className="Image" alt="" src="image/chef.jpg" />
                <h2>Login</h2>
                <form>
                    <div>
                        <h1>Live Face Recognition</h1>
                        <FaceLogin />
                    </div>
                </form>
            </main>
        </div>
    );
};

const FaceReg = () => {
    return (
        <div id="loginform">
            <main className="box">
                <img className="Image" alt="" src="image/chef.jpg" />
                <h2>Register</h2>
                <form>
                    <div>
                        <h1>얼굴 등록</h1>
                        <FaceRegister />
                    </div>
                </form>
            </main>
        </div>
    );
};

class App extends Component {
    render() {
        return (
            <BrowserRouter>
                <Route exact path="/" component={FaceRecog} />
                <Route exact path="/register" component={FaceReg} />
            </BrowserRouter>
        );
    }
}

export default App;
